        internal static void BuildIn(ref int[] incomingArray)
        {
            Array.Sort(incomingArray);
        }

        internal static void BubbleSimple(ref int[] incomingArray)
        {
            for (int i = 1; i < incomingArray.Length; i++)
            {
                for (int j = i; j < incomingArray.Length; j++)
                {
                    if (incomingArray[i] > incomingArray[j])
                    {
                        (incomingArray[i], incomingArray[j]) = (incomingArray[j], incomingArray[i]);
                    }
                }
            }
        }

        internal static void HalfingMethod(ref int[] incomingArray)
        {
            var length = incomingArray.Length;
            var sublength = length / 2;
            var firstSubarray = incomingArray[0..sublength];
            var secondSubarray = incomingArray[sublength..];
            Array.Sort(firstSubarray);
            Array.Sort(secondSubarray);
            var firstCounter = 0;
            var secondCounter = 0;

            for (int i = 0; i < length; i++)
            {
                if (firstSubarray[firstCounter] <= secondSubarray[secondCounter])
                {
                    incomingArray[i] = firstSubarray[firstCounter];
                    firstCounter++;
                }
                else
                {
                    incomingArray[i] = secondSubarray[secondCounter];
                    secondCounter++;
                }
            }
            
        }
    }
